{"query":"query Proposals {
              proposals (
              first: 20,
              skip: 0,
              where: {
              space_in: ["idlefinance.eth"],
              state:"active"
              },
              orderBy: "created",
              orderDirection: desc
              ) {
              id
              ipfs
              strategies{
                params
              }
              title
              body
              choices
              start
              end
              snapshot
              state
              author
              space {
              id
              name
              }
              }
              }"}

